• The key psychological mechanism is fairness evaluation: As a proposer, participants seem to base their offer on the relative contributions (tokens) of both themselves and their opponent. This “fairness ratio” can be computed as the difference between the opponent’s and the participant’s tokens normalized by their sum.
• This mechanism implies that when both contributions are equal, a fair split (50% to each) is expected; deviations in contributions linearly shift the proposer’s offer away from 50%. 
• Mathematically, the interaction can be captured by a linear equation where the predicted proposed percentage equals a fairness baseline (fixed at 50) plus a sensitivity parameter (beta) multiplied by the normalized difference in tokens.
• The only learnable parameter, beta, calibrates how strongly individuals adjust their offers based on the contributions’ imbalance. This simplicity minimizes parameter covariance.
